CREATE TABLE employee_recruitment(
   id                          INT  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,DOJ_Extended                VARCHAR(3) NOT NULL
  ,Duration_to_accept_offer    INTEGER  NOT NULL
  ,Notice_period               INTEGER  NOT NULL
  ,Offered_band                VARCHAR(2) NOT NULL
  ,Pecent_hike_expected_in_CTC VARCHAR(6) NOT NULL
  ,Percent_hike_offered_in_CTC VARCHAR(6) NOT NULL
  ,Percent_difference_CTC      VARCHAR(6) NOT NULL
  ,Joining_Bonus               VARCHAR(3) NOT NULL
  ,Candidate_relocate_actual   VARCHAR(3) NOT NULL
  ,Gender                      VARCHAR(6) NOT NULL
  ,Candidate_Source            VARCHAR(17) NOT NULL
  ,Rex_in_Yrs                  INTEGER  NOT NULL
  ,LOB                         VARCHAR(10) NOT NULL
  ,Location                    VARCHAR(9) NOT NULL
  ,Age                         INTEGER  NOT NULL
  ,Status                      VARCHAR(10) NOT NULL
);
